import React from 'react'
import "./scroll.css"
function ScrollDown() {
  return (
    <a className='rotatedScroll' href="#aboutme">
          <div className="line"></div>
          <div className="scroll">Scroll Down </div>
          <div className="line"></div>

    </a>
  )
}

export default ScrollDown
